import '../App.css';

import ProfilePic from '../Assets/ProfilePic.jpg'

export default function AboutMe() {
    return (
        <div>
            
            <div class ="image-cropper">
                <img 
                    alt="Profile" 
                    src = {ProfilePic} 
                    class ="profile-pic"
                    //style={{width: 280, height: 400, borderRadius: "50%", }} 
                />
            </div>
            <section id = "AboutMe">
          <p>About Me</p>
          <p>About Me</p>
          <p>About Me</p>
          <p>About Me</p>
        </section>
        </div>
    )
}
